import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import PracticeTile from './components/practicetile';
import PracticeButton from './components/practicebutton';
import PracticeContainer from './components/practicebutton';
import PracticeFooter from './components/practicebutton';
import PracticeColumns from './components/practicebutton';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();

< PracticeTile />;
< PracticeButton />;
< PracticeContainer />;
< PracticeFooter />;
< PracticeColumns />;
